import React, { useState } from 'react';
import Form from './Form';

const App = () => {
  //states
  const [city, setCity] = useState('');

  const callApi = async () => {
    const url =
      'https://api.openweathermap.org/data/2.5/weather?q=Philadelphia&appid=09cb87e3b19945bb6949563cd21ace23'; //need to change philadelphia to STATE
    const response = await fetch(url, { mode: 'cors' });
    const data = await response.json();
    const temp = data.main.temp;
    console.log(temp);

    return temp;
  };

  return <Form />;
};

export default App;
